    def parse_trade(self, trade, market):
        timestamp = self.safe_timestamp(trade, 'time')
        price = self.safe_float(trade, 'price')
        cost = self.safe_float(trade, 'amount')
        sideTmp = self.safe_integer(trade, 'side')
        id = self.safe_string(trade, 'tradeId')
        side = None
        if sideTmp == 1:
            side = 'sell'
        elif sideTmp == 0:
            side = 'buy'
        buyFee = self.safe_float(trade, 'buyFee')
        sellFee = self.safe_float(trade, 'sellFee')
        amount = self.safe_float(trade, 'quantity')
        quoteTokenSymbol = self.safe_string(trade, 'quoteTokenSymbol')
        fee = {
            'cost': None,
            'currency': self.format_symbol_token(quoteTokenSymbol),
        }
        if side == 'buy':
            fee['cost'] = buyFee
        elif side == 'sell':
            fee['cost'] = sellFee
        symbol = None
        if market is not None:
            symbol = market['symbol']
        return {
            'info': trade,
            'timestamp': timestamp,
            'datetime': self.iso8601(timestamp),
            'symbol': symbol,
            'id': id,
            'order': id,
            'type': None,
            'takerOrMaker': None,
            'side': side,
            'price': price,
            'amount': amount,
            'cost': cost,
            'fee': fee,
        }

